import React, { Component } from 'react';
import ReactDOM from 'react-dom';

class Test extends Component {

componentDidMount() {
    fetch('http://dev.frevend.com/json/users.json')
    .then(function(data){
        data.json();
        console.log(data);
    })

    
}
    render() {
        return(
            <div>
                test message
            </div>
        );
    }
}
export default Test;
